package strings;

public class FunnyString {

	public static String funnyString(String s) {
	    String forward="", backward="";
	    for(int i=0; i<s.length()-1; i++){
	    	forward= forward + Math.abs(s.charAt(i)-s.charAt(i+1));
	    }
	    for(int i=s.length()-1; i>0; i--){
	    	backward= backward + Math.abs(s.charAt(i)-s.charAt(i-1));
	    }
//	    System.out.println(forward+" "+ backward);
	    return forward.equals(backward) ? "Funny" : "Not Funny";
	}
	public static void main(String[] args) {
		String[] str = {
				"",
				"",
				"",
				"",
				"",
				"",
				"",
				"",
				"",
				"",
				};
		for (int i = 0; i < str.length; i++) {
			
			System.out.println(funnyString(str[i]));
		}
	}
}
